import React from 'react';
import logPic from '../img/log-pic.png'; // Importing the image correctly

const Login = () => {
    return (
        <div className="login-container">
            <div className="login-all">
                <div className="log-info">
                    <h1>Welcome!</h1>
                    <label htmlFor="email">Email</label> {/* Use htmlFor instead of for */}
                    <input className="email" type="text" />
                    <label htmlFor="password">Password</label>
                    <input className="password" type="password" />
                    <button>Login</button>

                    <p>Don't have an account? Sign up <a href="">here</a>.</p>
                </div>
                <div className="log-img">
                    <img src={logPic} alt="Login illustration" /> {/* Add alt text for accessibility */}
                </div>
            </div>
        </div>
    );
}

export default Login;
